syntax = "proto3";
//生成文件所在包名
option java_package = "com.gejian.pixel.proto";
//生成的java文件名
option java_outer_classname = "ConstRanklistHonorTableItemExProtobuf";

message	ConstRanklistHonorTableItemEx  {
	 uint32	id = 1;
	 uint32	section_fomula = 2;
	 string	section = 3;
	 string	award_fomula = 4;
	 string	award = 5;
	 string	time = 6;
}